class F_1_2_1 :
        public ScalarFunction {
    double compute(const Vector &x) const override {
        return x[0] * x[0] + x[1] * x[1] - 1.2 * x[0] * x[1];
    }

    Vector gradient(const Vector &x) const override {
        return Vector({
                              2 * x[0] - 1.2 * x[1], 2 * x[1] - 1.2 * x[0]
                      });
    }

    DenseMatrix hessian(const Vector &x) const override {
        return DenseMatrix({
                                   {
                                           2,    -1.2
                                   },
                                   {
                                           -1.2, 2
                                   }
                           });
    }
};


class F_1_2_2 :
        public ScalarFunction {
    double compute(const Vector &x) const override {
        double m1 = (x[1] - x[0] * x[0]);
        double m2 = (1.0 - x[0]);
        return 100.0 * m1 * m1 + m2 * m2;
    }

    Vector gradient(const Vector &x) const override {
        return Vector({
                              2 * (200 * x[0] * x[0] * x[0] - 200 * x[0] * x[1] + x[0] - 1),
                              200 * (x[1] - x[0] * x[0])
                      });
    }

    DenseMatrix hessian(const Vector &x) const override {
        return DenseMatrix({
                                   {
                                           -400 * (x[1] - x[0] * x[0]) + 800 * x[0] * x[0] + 2, -400 * x[0]
                                   },
                                   {
                                           -400 * x[0],                                         200
                                   }
                           });
    }
};


class F_1_1_1 :
        public ScalarFunction {
    double compute(const Vector &x) const override {
        return atan(x[0] * x[0]) + x[1] * x[1];
    }

    Vector gradient(const Vector &x) const override {
        return Vector({
                              (2 * x[0]) / (x[0] * x[0] * x[0] * x[0] + 1),
                              2 * x[1]
                      });
    }

    DenseMatrix hessian(const Vector &x) const override {
        double m = x[0] * x[0] * x[0] * x[0] + 1;
        return DenseMatrix({
                                   {
                                           2 / (x[0] * x[0] * x[0] * x[0] + 1) -
                                           (8 * x[0] * x[0] * x[0] * x[0]) / (m * m), 0
                                   },
                                   {
                                           0,                                         2
                                   }
                           });
    }
};


class F_1_1_2 :
        public ScalarFunction {
    double compute(const Vector &x) const override {
        return 0.25 * (x[0] * x[0] * x[0] * x[0]) + (x[1] * x[1] * x[1] * x[1]) + (x[0] * x[0]);
    }

    Vector gradient(const Vector &x) const override {
        return Vector({
                              x[0] * x[0] * x[0] + 2 * x[0], 4 * x[1] * x[1] * x[1]
                      });
    }

    DenseMatrix hessian(const Vector &x) const override {
        return DenseMatrix({
                                   {
                                           3 * x[0] * x[0] + 2, 0
                                   },
                                   {
                                           0,                   12 * x[1] * x[1]
                                   }
                           });
    }
};


